import React from 'react';
import './App.css';
import ReactCanvasNest from 'react-canvas-nest';

function App() {
    return ( < div className = "App" > < ReactCanvasNest className = 'canvasNest'
        config = {
            {
                pointColor: ' 255, 255, 255 '
            }
        }
        style = {
            {
                zIndex: 99
            }
        }
        />  < /div> );
}
export default App;
